import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import All from "./All";

function App() {
  return (
    <Router>
      <Route exact path="/uncompleted" component={Home} />
    </Router>
  );
}

export default App;
